To achieve this, you can use the Date object in JavaScript and calculate the difference between the current time and the time the post was made. Here's a TypeScript function that does this:

```typescript
function timeAgo(date: Date): string {
  const currentTime = new Date();
  const elapsedTime = currentTime.getTime() - date.getTime();

  // In seconds
  const seconds = Math.floor(elapsedTime / 1000);
  const minutes = Math.floor(seconds / 60);
  const hours = Math.floor(minutes / 60);
  const days = Math.floor(hours / 24);
  const years = Math.floor(days / 365);

  if (years > 1) {
    return `${years} years ago`;
  }

  if (days > 1) {
    return `${days} days ago`;
  }

  if (hours > 1) {
    return `${hours} hours ago`;
  }

  if (minutes > 1) {
    return `${minutes} minutes ago`;
  }

  // Less than a minute
  return `${seconds} seconds ago`;
}
```

